    }

    return (
        <div>
            <h1> Become a seller?</h1>
            <form>
            <input type="text" placeholder="Shoe Name" onChange={handleChange}/><br/>
                <input type="text" placeholder="ImgURL"/> <br/>
                <input type="text" placeholder="price"/><br/>
                <input type="text" placeholder="details"/><br/>

                <input type="submit" value="add new shoe"/>
            </form>

        </div>
    )

}

export default ProductForm;
